import BarChart from "./BarChart3";

  const data = [
    {race: 2, number:1000},
    {race: 3, number:2000},
    {race: 6, number:3000},
    {race: 8, number:2000},
    {race: 10, number:1000},

    // {year: 1980, efficiency: 24.3, sales: 8949000},
